import React from "react";
// import {logo} from "../assets/logo.png"


function Sidebar() {
  return (
    <div className="sidebar">
      <img
        src="https://invoyz.reylab.tech/_next/image?url=%2Flogo.png&w=128&q=75"
        alt="logo"
        className="sidebar__logo"
      />
      <div>
        <img src={"../assets/icon-sun.svg"} alt="sun" />
        <img
          src={
            "https://invoyz.reylab.tech/_next/image?url=%2Fassets%2Fimage-avatar.jpg&w=32&q=75"
          }
          alt="avatar"
        />
      </div>
    </div>
  );
}

export default Sidebar;
